def count_liked_numbers(n):
    liked_numbers = []
    for i in range(1, n + 1):
        root_square = int(i ** 0.5)
        root_cube = int(i ** (1. / 3))
        if root_square * root_square == i or root_cube * root_cube * root_cube == i:
            liked_numbers.append(i)
    return len(liked_numbers)
